import React from 'react'; // get the React object from the react module
import './feed.css';
import SliderPage from './slider';

class Feed extends React.Component {
  render() {
    return(
        <div>
            <div>
                        <label className='label'>A. TIME MANAGEMENT SKILLS</label>
                        <p>1 <i class="fa fa-arrow-right"></i> Punctuality in the Class<SliderPage /></p>
                        <p>2 &#xf062; Regularity in taking Classes<SliderPage /></p>
                        <p>3. Student's attendance/presence in the class of teacher who is being evaluated<SliderPage /></p>
                        <p>4. Completes syllabus of the course as per teaching plan<SliderPage /></p>
                        <p>5. Scheduled organization of assignments, class, test, quizzes and seminars<SliderPage /></p>
                        <p className='last'>6. Makes alternate arrangement of class in his/her absence<SliderPage /></p>
            </div>

        </div>

    );
  }
}

export default Feed;
